import { createRouter, createWebHistory } from 'vue-router'
import RickAndMorty from '../views/RickAndMorty.vue'
// import Portafolio from '../views/Portafolio.vue'  // ← Comenta temporalmente
import AnimeView from '../views/Anime.vue'  // ← Nombre actualizado

const routes = [
  {
    path: '/',
    name: 'RickAndMorty',
    component: RickAndMorty
  },
  /*{
    path: '/portafolio',
    name: 'Portafolio',
    component: Portafolio
  },*/
  {
    path: '/anime',
    name: 'AnimeView',  // ← Nombre actualizado
    component: AnimeView
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
